`,paraId:33,tocIndex:11},{value:"work in process \u8868\u793A\u5F53\u524D\u6B63\u5728\u5904\u7406\u7684 fiber \u8282\u70B9\u3002",paraId:34,tocIndex:11},{value:"\u6211\u4EEC\u770B\u5230\u4E86\uFF0C\u521D\u59CB\u5316\u5DE5\u4F5C\u5B8C\u6210\u540E\uFF0C\u4F3C\u4E4E\u6CA1\u6709\u6E32\u67D3\u7684\u64CD\u4F5C\uFF0C\u53EA\u662F new \u4E86\u4E00\u5806\u5BF9\u8C61\u3002\u6240\u4EE5\u9700\u8981\u521B\u5EFA\u4E00\u4E2A\u8C03\u5EA6\u4EFB\u52A1\u3002",paraId:35,tocIndex:11},{value:"\u6D4F\u89C8\u5668\u6709\u81EA\u5DF1\u7684\u8C03\u5EA6\u5DE5\u5177\uFF1A",paraId:36,tocIndex:12},{value:"\u8FD9\u91CC\u6211\u4EEC\u6682\u4E14\u4F7F\u7528\u6D4F\u89C8\u5668\u81EA\u5E26\u7684\u7A7A\u95F2\u65F6\u95F4\u7247\u8C03\u5EA6\u5DE5\u5177\u3002\u7531\u4E8E\u8003\u8651\u5230\u517C\u5BB9\u6027\uFF0CReact \u81EA\u5DF1\u5B9E\u73B0\u4E86\u8FD9\u4E2A\u51FD\u6570\uFF0C\u653E\u5728 Scheduler \u91CC\uFF0C\u4E0B\u8FB9\u4F1A\u8BB2\u5230\u3002",paraId:37,tocIndex:12},{value:`// TODO\uFF1Areact scheduler \u90E8\u5206\u539F\u751F\u5B9E\u73B0\u4E86\u4E00\u5957\uFF1A\u6D4F\u89C8\u5668\u4E8B\u4EF6\u5FAA\u73AF\u7A7A\u95F2\u65F6\u95F4\u6BB5\u5185\u8C03\u7528\u51FD\u6570\u6392\u961F
